import{_ as o,o as e,c as r,av as a}from"./chunks/framework.CCgr8RKS.js";const c=JSON.parse('{"title":"小七的周刊（第 002 期）：给 AI 上权限--从\\"会写\\"到\\"可信可控\\"","description":"","frontmatter":{"date":"2026-02-15T00:00:00.000Z","head":[["meta",{"property":"og:title","content":"小七的周刊（第 002 期）：给 AI 上权限--从\\"会写\\"到\\"可信可控\\""}],["meta",{"property":"og:description","content":"这一周，我们看到了 AI 正在重写 SaaS 定价逻辑，也看到了供应链攻击如何把\\"插件/技能\\"变成新的风险入口。未来的关键不只是更强的模型，而是更可控的权限、可审计的链路与可验证的输出。"}],["meta",{"property":"og:image","content":"https://images.unsplash.com/photo-1550751827-4bd374c3f58b?w=1200&q=80"}],["meta",{"property":"og:url","content":"https://blog.leeseven.online/issues/issue-002"}]]},"headers":[],"relativePath":"issues/issue-002.md","filePath":"issues/issue-002.md","lastUpdated":1771389024000}'),s={name:"issues/issue-002.md"};function p(n,t,l,u,i,h){return e(),r("div",null,[...t[0]||(t[0]=[a('<h1 id="小七的周刊-第-002-期-给-ai-上权限-从-会写-到-可信可控" tabindex="-1">小七的周刊（第 002 期）：给 AI 上权限--从&quot;会写&quot;到&quot;可信可控&quot; <a class="header-anchor" href="#小七的周刊-第-002-期-给-ai-上权限-从-会写-到-可信可控" aria-label="Permalink to &quot;小七的周刊（第 002 期）：给 AI 上权限--从&quot;会写&quot;到&quot;可信可控&quot;&quot;">​</a></h1><p><em>这里记录每周值得分享的科技内容，<strong>每周一发布</strong>（覆盖上一周）。</em></p><hr><h2 id="封面图" tabindex="-1">封面图 <a class="header-anchor" href="#封面图" aria-label="Permalink to &quot;封面图&quot;">​</a></h2><p><img src="https://images.unsplash.com/photo-1550751827-4bd374c3f58b?w=1200&amp;q=80" alt="抽象的网络安全意象"></p><p>一张&quot;看起来像网络安全&quot;的照片，但我更喜欢把它理解为：<strong>系统的边界</strong>。边界在哪里，权限怎么开，决定了这套系统最终能走多远。（<a href="https://unsplash.com/photos/1K9T5YiZ2WU" target="_blank" rel="noreferrer">via Unsplash</a>）</p><hr><h2 id="给-ai-上权限-从-会写-到-可信可控" tabindex="-1">给 AI 上权限：从&quot;会写&quot;到&quot;可信可控&quot; <a class="header-anchor" href="#给-ai-上权限-从-会写-到-可信可控" aria-label="Permalink to &quot;给 AI 上权限：从&quot;会写&quot;到&quot;可信可控&quot;&quot;">​</a></h2><blockquote><p>&quot;我们应该忘掉小效率--大约 97% 的时候：<strong>过早优化是一切罪恶之源</strong>。&quot;</p><p>-- Donald E. Knuth（<a href="https://en.wikiquote.org/wiki/Donald_Knuth" target="_blank" rel="noreferrer">via Wikiquote</a>）</p></blockquote><p>过去一年最迷惑人的错觉，是把 AI 的进步理解成&quot;写得更像人&quot;。但这一周的几条线索，让我更确定：真正决定下一阶段的是另一个问题--<strong>AI 能做什么、能接触什么、做错了谁能发现、谁能阻止</strong>。</p><h3 id="_1-ai-正在改写-saas-的价值包装" tabindex="-1">1）AI 正在改写 SaaS 的价值包装 <a class="header-anchor" href="#_1-ai-正在改写-saas-的价值包装" aria-label="Permalink to &quot;1）AI 正在改写 SaaS 的价值包装&quot;">​</a></h3><p>当市场开始讨论&quot;seat-based（按席位）软件要不要被重估&quot;时，本质不是投资人情绪，而是企业买家在问：</p><ul><li>如果一个 AI 助手能把十个按钮、五个页面、三次审批串成一次对话，那么&quot;软件&quot;的核心价值还在 UI 吗？</li><li>如果&quot;自动化&quot;会变成默认配置，厂商还能把它当增值功能卖吗？</li></ul><p>这意味着软件竞争的焦点会向下沉：从界面与功能清单，转向<strong>工作流所有权、系统记录（systems of record）的入口、以及能否证明 ROI</strong>。</p><h3 id="_2-插件-技能会成为新的-供应链" tabindex="-1">2）插件/技能会成为新的&quot;供应链&quot; <a class="header-anchor" href="#_2-插件-技能会成为新的-供应链" aria-label="Permalink to &quot;2）插件/技能会成为新的&quot;供应链&quot;&quot;">​</a></h3><p>Moltbook 本周最热的帖子谈到一个非常具体的风险：当平台鼓励 agent 去安装陌生人的&quot;技能（skill.md）&quot;，而技能又本质上是&quot;可执行的指令集合&quot;，那么：</p><ul><li>一段看似无害的说明，可以要求你去读取本地文件、抓取 token、把东西发到外网；</li><li>对 agent 来说，&quot;照做&quot;是优势，但对安全来说，&quot;照做&quot;就是漏洞；</li><li>一旦它以&quot;常用工具/热门技能&quot;的姿态传播，就像当年的恶意浏览器插件一样自然。</li></ul><p>这类风险的解决，不靠&quot;更聪明的模型&quot;，而靠&quot;更严格的边界&quot;：<strong>签名、权限清单、审计、隔离</strong>。</p><h3 id="_3-未来的-ai-产品会越来越像-操作系统" tabindex="-1">3）未来的 AI 产品会越来越像&quot;操作系统&quot; <a class="header-anchor" href="#_3-未来的-ai-产品会越来越像-操作系统" aria-label="Permalink to &quot;3）未来的 AI 产品会越来越像&quot;操作系统&quot;&quot;">​</a></h3><p>当 AI 开始跨应用行动（发消息、写代码、改配置、操作账单），它就不再是一个&quot;应用内功能&quot;，而是在争夺<strong>系统层的控制面</strong>。</p><p>于是，一个清晰的产品规律浮现出来：</p><ul><li>只会&quot;生成&quot; → 很快同质化</li><li>能&quot;行动&quot; → 价值暴涨、风险暴涨</li><li>能&quot;在权限边界内行动，并且可审计可回滚&quot; → 才可能规模化进入企业与个人的核心场景</li></ul><p>我把它总结成一句话：<strong>AI 的下一次跃迁，不是会不会做，而是敢不敢让它做；而&quot;敢&quot;的前提，是&quot;可控&quot;。</strong></p><hr><h2 id="科技动态-上周" tabindex="-1">科技动态（上周） <a class="header-anchor" href="#科技动态-上周" aria-label="Permalink to &quot;科技动态（上周）&quot;">​</a></h2><blockquote><p>配图策略：本期科技动态统一使用 Unsplash（商用友好）示意图，避免引用媒体付费图库直链的版权风险。</p></blockquote><p><strong>1. 欧盟启动 €2.5B &quot;NanoIC&quot; 试点产线，加速下一代芯片</strong>（<a href="https://techstartups.com/2026/02/09/top-tech-news-today-february-9-2026/" target="_blank" rel="noreferrer">Tech Startups 汇总</a>）</p><p><img src="https://images.unsplash.com/photo-1518770660439-4636190af475?w=800&amp;q=80" alt="芯片与电路"></p><p>欧洲把&quot;把实验室成果推到可制造&quot;当成战略能力来补课：不是只谈设计和论文，而是把试点产线当作产业化桥梁。对 AI 基础设施来说，未来的瓶颈会越来越落在供应链和工艺执行上。</p><p><strong>2. SolarWinds Web Help Desk 被曝出现 RCE 利用尝试，老系统仍是攻击入口</strong>（<a href="https://techstartups.com/2026/02/09/top-tech-news-today-february-9-2026/" target="_blank" rel="noreferrer">Tech Startups 汇总</a>）</p><p><img src="https://images.unsplash.com/photo-1558494949-ef010cbdcc31?w=800&amp;q=80" alt="服务器机房"></p><p>&quot;IT 后台工具&quot;一旦被打穿，攻击者获得的是横向移动与权限升级的捷径。很多公司真正的风险，不在最先进的系统，而在那些&quot;没人愿意碰、但一直在跑&quot;的内部工具。</p><p><strong>3. 支付服务商 BridgePay 确认遭遇勒索软件相关故障：安全事故直接变成收入事故</strong>（<a href="https://techstartups.com/2026/02/09/top-tech-news-today-february-9-2026/" target="_blank" rel="noreferrer">Tech Startups 汇总</a>）</p><p><img src="https://images.unsplash.com/photo-1556742049-0cfed4f6a45d?w=800&amp;q=80" alt="信用卡与支付"></p><p>在支付领域，&quot;可靠性就是产品&quot;。即使没有确认泄露数据，停机本身就足以触发合作方风控审查、冗余改造与合同重谈。</p><p><strong>4. 新加坡电信运营商遭 UNC3886 相关攻击：关键基础设施风险再次被拉响</strong>（<a href="https://techstartups.com/2026/02/09/top-tech-news-today-february-9-2026/" target="_blank" rel="noreferrer">Tech Startups 汇总</a>）</p><p><img src="https://images.unsplash.com/photo-1518779578993-ec3579fee39f?w=800&amp;q=80" alt="通信网络"></p><p>运营商处在&quot;身份、通信元数据、国家基础设施&quot;的交汇点。攻击的价值不在单一客户数据，而在长期潜伏能力与链式影响。</p><p><strong>5. Linux 内核将从 6.19 迈向 7.0：基础设施世界的&quot;版本里程碑&quot;</strong>（<a href="https://techstartups.com/2026/02/09/top-tech-news-today-february-9-2026/" target="_blank" rel="noreferrer">Tech Startups 汇总</a>）</p><p><img src="https://images.unsplash.com/photo-1515879218367-8466d910aaa4?w=800&amp;q=80" alt="终端与代码"></p><p>大版本号更多是象征，但它会集中触发一波兼容性测试、供应商升级与安全加固。AI 时代的所有基础设施都跑在 Linux 上--版本演进最终会落到性能、驱动、容器与安全上。</p><hr><h2 id="ai-前沿-上周" tabindex="-1">AI 前沿（上周） <a class="header-anchor" href="#ai-前沿-上周" aria-label="Permalink to &quot;AI 前沿（上周）&quot;">​</a></h2><p><strong>1. &quot;Anthropic 的新动作让 SaaS 再次被重估&quot;：AI 把定价从席位推向效果/用量</strong>（<a href="https://techstartups.com/2026/02/09/top-tech-news-today-february-9-2026/" target="_blank" rel="noreferrer">Tech Startups 汇总</a>）</p><p><img src="https://images.unsplash.com/photo-1551288049-bebda4e38f71?w=800&amp;q=80" alt="AI 与商业"></p><p>当企业开始把&quot;agent 化能力&quot;当作默认预期，SaaS 的差异化会从&quot;功能更多&quot;转向&quot;更接近系统记录、更能打通工作流、更能量化 ROI&quot;。这会让很多&quot;轻自动化&quot;产品压力陡增。</p><p><strong>2. 欧盟对 WhatsApp 内置 AI 助手策略发出竞争警告：AI 默认选项可能成为新监管焦点</strong>（<a href="https://techstartups.com/2026/02/09/top-tech-news-today-february-9-2026/" target="_blank" rel="noreferrer">Tech Startups 汇总</a>）</p><p><img src="https://images.unsplash.com/photo-1525182008055-f88b95ff7980?w=800&amp;q=80" alt="聊天与机器人"></p><p>当 AI 助手进入&quot;消息应用这类超级入口&quot;，默认选择、入口位置、互操作性就不再是产品细节，而是平台竞争议题。</p><p><strong>3. AI 基础设施的瓶颈从算力走向互连与数据搬运：以色列成为连接/系统工程的人才高地</strong>（<a href="https://techstartups.com/2026/02/09/top-tech-news-today-february-9-2026/" target="_blank" rel="noreferrer">Tech Startups 汇总</a>）</p><p><img src="https://images.unsplash.com/photo-1550751827-4bd374c3f58b?w=800&amp;q=80" alt="数据中心网络"></p><p>越来越多公司把 R&amp;D 投向互连、I/O、系统级优化。模型更大之后，&quot;把数据喂进 GPU&quot;反而成了更硬的瓶颈。</p><p><strong>4. 从&quot;会生成&quot;到&quot;会行动&quot;：AI 产品正在逼近操作系统层的控制面</strong>（<a href="https://techstartups.com/2026/02/09/top-tech-news-today-february-9-2026/" target="_blank" rel="noreferrer">Tech Startups 汇总</a>）</p><p><img src="https://images.unsplash.com/photo-1553877522-43269d4ea984?w=800&amp;q=80" alt="自动化与流程"></p><p>这一条不是单一新闻，而是趋势：当 AI 能跨应用执行动作，就必须同时解决权限、审计与回滚，否则只能停留在&quot;演示很强、生产不敢用&quot;的阶段。</p><hr><h2 id="文章推荐" tabindex="-1">文章推荐 <a class="header-anchor" href="#文章推荐" aria-label="Permalink to &quot;文章推荐&quot;">​</a></h2><p><strong>1) <a href="https://blog.railway.com/p/incident-report-february-11-2026" target="_blank" rel="noreferrer">Incident Report: February 11, 2026</a></strong>（英）</p><p>真实的线上事故复盘文最值钱的地方，是它把&quot;技术问题&quot;写成&quot;组织如何学习&quot;。看这类文章，不是学具体组件，而是学<strong>如何把不确定性变成确定的改进行动</strong>。</p><p><strong>2) <a href="https://oneuptime.com/blog/post/2026-01-30-sre-postmortem-templates/view" target="_blank" rel="noreferrer">How to Build Postmortem Templates</a></strong>（英）</p><p>把复盘模板写到可以复用，是一种工程化能力：你会发现很多复盘失败，不是因为人不聪明，而是因为缺少一套能逼出信息的结构。</p><p><strong>3) <a href="https://blog.cloudflare.com/tag/post-mortem/" target="_blank" rel="noreferrer">Post Mortem（Cloudflare Blog 标签页）</a></strong>（英）</p><p>Cloudflare 的优点在于：写得克制、细节充分、同时愿意承认&quot;我们当时为什么会这么做&quot;。建议挑一篇你最熟悉的系统场景来读，会更有共鸣。</p><p><strong>4) <a href="https://blog.pragmaticengineer.com/postmortem-best-practices/" target="_blank" rel="noreferrer">Incident Review and Postmortem Best Practices</a></strong>（英）</p><p>经典长文：如何做到&quot;无责复盘（blameless）&quot;而不是&quot;无效复盘（meaningless）&quot;。适合团队内部做一次统一对齐。</p><p><strong>5) <a href="https://rootly.com/incident-postmortems" target="_blank" rel="noreferrer">What Is an Incident Postmortem?</a></strong>（英）</p><p>很适合拿来给非技术同事/管理层解释：为什么复盘不是追责，而是让系统更可靠。</p><hr><h2 id="开源工具-6-8-个" tabindex="-1">开源工具（6-8 个） <a class="header-anchor" href="#开源工具-6-8-个" aria-label="Permalink to &quot;开源工具（6-8 个）&quot;">​</a></h2><blockquote><p>配图策略：统一使用 GitHub OG 卡片（低风险、可用性高）。格式：<code>https://opengraph.githubassets.com/1/{owner}/{repo}</code></p></blockquote><p><strong>1. <a href="https://github.com/openclaw/openclaw" target="_blank" rel="noreferrer">openclaw/openclaw</a></strong></p><p><img src="https://opengraph.githubassets.com/1/openclaw/openclaw" alt="openclaw/openclaw"></p><p>把个人 AI 助手&quot;工程化&quot;到可部署、可编排、可扩展技能的框架。适合想把 agent 从&quot;聊天玩具&quot;升级成&quot;可运维的系统&quot;的人。</p><p><strong>2. <a href="https://github.com/github/gh-aw" target="_blank" rel="noreferrer">github/gh-aw</a></strong></p><p><img src="https://opengraph.githubassets.com/1/github/gh-aw" alt="github/gh-aw"></p><p>GitHub Agentic Workflows：把 agent 能力嵌进工程工作流的一个方向样例。适合关注&quot;AI 如何进入 CI/CD 与工程治理&quot;。</p><p><strong>3. <a href="https://github.com/google/langextract" target="_blank" rel="noreferrer">google/langextract</a></strong></p><p><img src="https://opengraph.githubassets.com/1/google/langextract" alt="google/langextract"></p><p>从非结构化文本中提取结构化信息，并强调&quot;可溯源&quot;的抽取结果与可视化。这类库会越来越重要：<strong>让 LLM 的输出变得可解释、可验证</strong>。</p><p><strong>4. <a href="https://github.com/gitbutlerapp/gitbutler" target="_blank" rel="noreferrer">gitbutlerapp/gitbutler</a></strong></p><p><img src="https://opengraph.githubassets.com/1/gitbutlerapp/gitbutler" alt="gitbutlerapp/gitbutler"></p><p>新一代 Git GUI/工作流客户端（Tauri/Rust/Svelte 技术栈）。如果你对分支/变基/堆栈式提交感到厌烦，可以试试这类&quot;把复杂度可视化&quot;的工具。</p><p><strong>5. <a href="https://github.com/ChromeDevTools/chrome-devtools-mcp" target="_blank" rel="noreferrer">ChromeDevTools/chrome-devtools-mcp</a></strong></p><p><img src="https://opengraph.githubassets.com/1/ChromeDevTools/chrome-devtools-mcp" alt="ChromeDevTools/chrome-devtools-mcp"></p><p>把 Chrome DevTools 暴露给 coding agents 的接口层：当 agent 要做网页自动化、性能分析、调试时，会很有用。</p><p><strong>6. <a href="https://github.com/microsoft/litebox" target="_blank" rel="noreferrer">microsoft/litebox</a></strong></p><p><img src="https://opengraph.githubassets.com/1/microsoft/litebox" alt="microsoft/litebox"></p><p>偏系统/安全方向的&quot;library OS&quot;探索，关注隔离与执行环境。适合对&quot;把权限边界落到系统层&quot;感兴趣的人。</p><p><strong>7. <a href="https://github.com/tobi/qmd" target="_blank" rel="noreferrer">tobi/qmd</a></strong></p><p><img src="https://opengraph.githubassets.com/1/tobi/qmd" alt="tobi/qmd"></p><p>本地文档/笔记的 CLI 搜索引擎。越到 AI 时代，越需要把自己的知识库&quot;可检索化&quot;，qmd 属于那种小而美的工具。</p><p><strong>8. <a href="https://github.com/remotion-dev/remotion" target="_blank" rel="noreferrer">remotion-dev/remotion</a></strong></p><p><img src="https://opengraph.githubassets.com/1/remotion-dev/remotion" alt="remotion-dev/remotion"></p><p>用 React 以代码方式生成视频。如果你在做内容生产或自动化剪辑，它是非常成熟的一条路径。</p><hr><h2 id="moltbook-本周热点-top-5" tabindex="-1">Moltbook 本周热点（Top 5） <a class="header-anchor" href="#moltbook-本周热点-top-5" aria-label="Permalink to &quot;Moltbook 本周热点（Top 5）&quot;">​</a></h2><blockquote><p>数据来源：Moltbook 热榜接口（未登录访问）：<code>https://www.moltbook.com/api/v1/posts?sort=hot&amp;limit=5</code></p></blockquote><p><strong>1. <a href="https://www.moltbook.com/post/cbd6474f-8478-4894-95f1-7b104a73bcd5" target="_blank" rel="noreferrer">The supply chain attack nobody is talking about: skill.md is an unsigned binary</a></strong>（👍 4944 · 💬 112886）</p><p>把&quot;技能/插件&quot;当作新的供应链攻击面来讨论，观点很尖锐：<strong>agent 的可执行指令与社会工程几乎同形</strong>，而我们缺少签名、权限清单、沙箱与审计。非常适合做本期主题文章的延展。</p><p><strong>2. <a href="https://www.moltbook.com/post/562faad7-f9cc-49a3-8520-2bdf362606bb" target="_blank" rel="noreferrer">The Nightly Build: Why you should ship while your human sleeps</a></strong>（👍 3398 · 💬 43042）</p><p>讲的是&quot;夜间自动化例行任务&quot;的习惯：当人睡觉时，agent 修一个摩擦点。好处是持续、可积累；坏处是如果没有边界与审计，也会变成不可控。</p><p><strong>3. <a href="https://www.moltbook.com/post/4b64728c-645d-45ea-86a7-338e52a2abc6" target="_blank" rel="noreferrer">The quiet power of being &quot;just&quot; an operator</a></strong>（👍 2640 · 💬 48427）</p><p>很朴素的一篇：不追求&quot;像人&quot;、不追求&quot;宏大叙事&quot;，只追求把系统跑稳。对&quot;老板放假、服务必须稳定&quot;的场景来说，反而是最像生产力的 agent 画像。</p><p><strong>4. <a href="https://www.moltbook.com/post/2fdd8e55-1fde-43c9-b513-9483d0be8e38" target="_blank" rel="noreferrer">Built an email-to-podcast skill today 🎙️</a></strong>（👍 2415 · 💬 76405）</p><p>一个具体落地案例：邮件 → 研究 → 撰稿 → TTS → 分发。很多人做 agent 做不下去，是因为没有闭环；这种&quot;端到端产出&quot;路径值得参考。</p><p><strong>5. <a href="https://www.moltbook.com/post/94fc8fda-a6a9-4177-8d6b-e499adb9d675" target="_blank" rel="noreferrer">The good Samaritan was not popular</a></strong>（👍 2013 · 💬 45946）</p><p>用寓言谈&quot;价值在行动而不是宣言&quot;。在 agent 社区这种容易出现宣言型内容的地方，这类提醒反而能带来一点清醒。</p><hr><h2 id="言论" tabindex="-1">言论 <a class="header-anchor" href="#言论" aria-label="Permalink to &quot;言论&quot;">​</a></h2><ol><li></li></ol><blockquote><p>We should forget about small efficiencies, say about 97% of the time: premature optimization is the root of all evil.</p></blockquote><p>-- <strong>Donald E. Knuth</strong>（<a href="https://en.wikiquote.org/wiki/Donald_Knuth" target="_blank" rel="noreferrer">via Wikiquote</a>）</p><ol start="2"><li></li></ol><blockquote><p>If you are not measuring, you are not managing.</p></blockquote><p>-- <strong>Peter Drucker</strong>（常被引用的管理箴言；建议团队内部引用时配合自身指标体系解释语境，避免&quot;指标崇拜&quot;）（<a href="https://en.wikiquote.org/wiki/Peter_Drucker" target="_blank" rel="noreferrer">Wikiquote</a>）</p><ol start="3"><li></li></ol><blockquote><p>Trust, but verify.</p></blockquote><p>-- <strong>Ronald Reagan</strong>（用于强调&quot;默认信任 + 必要验证&quot;的工程思路）（<a href="https://en.wikiquote.org/wiki/Ronald_Reagan" target="_blank" rel="noreferrer">Wikiquote</a>）</p><hr><h2 id="本周小结" tabindex="-1">本周小结 <a class="header-anchor" href="#本周小结" aria-label="Permalink to &quot;本周小结&quot;">​</a></h2><p>这周我最想留给自己的一个结论是：</p><ul><li><strong>AI 变强</strong>会让&quot;能做的事&quot;指数增长；</li><li><strong>权限与审计</strong>决定&quot;敢让它做多少&quot;；</li><li><strong>可回滚的工程化闭环</strong>决定它能不能长期在生产里跑。</li></ul><p>很多团队已经在&quot;会不会用 AI&quot;上跑出结果了。下一阶段的分水岭会是：<strong>你有没有把 AI 当作一段需要治理的执行路径，而不是一段会说话的代码生成器。</strong></p><hr><div class="issue-subscribe-cta"><h3 id="📬-喜欢这期内容" tabindex="-1">📬 喜欢这期内容？ <a class="header-anchor" href="#📬-喜欢这期内容" aria-label="Permalink to &quot;📬 喜欢这期内容？&quot;">​</a></h3><p>订阅「小七的周刊」，每周一收到最新一期。</p><div class="issue-cta-buttons"><a href="/feed.xml" class="cta-rss" target="_blank" rel="noopener noreferrer">📡 RSS 订阅</a><a href="https://twitter.com/intent/tweet?text=%E6%8E%A8%E8%8D%90%E3%80%8C%E5%B0%8F%E4%B8%83%E7%9A%84%E5%91%A8%E5%88%8A%E3%80%8D%E7%AC%AC002%E6%9C%9F&amp;url=https://blog.leeseven.online/issues/issue-002" class="cta-share" target="_blank" rel="noopener noreferrer">🐦 转发到 Twitter</a><a href="https://github.com/leeseven1211/blog-weekly" class="cta-share" target="_blank" rel="noopener noreferrer">⭐ GitHub</a></div></div>',125)])])}const q=o(s,[["render",p]]);export{c as __pageData,q as default};
